import React from 'react';
import "../App.css";
import BillView from '../components/BillView';


class Bill extends  React.Component{
      render()
    {
        return(
            <div>
                <div style={mainStyle}>
                   <BillView/>
                </div>
            </div>
        );
    }
}

const mainStyle={
    position:'fixed',
    backgroundColor:'LightGrey',
    width:"1390px",
    height:"500px",
    left:'11px',
    right:'220px',
    top: '100px',
    bottom: '10px'
};

export default Bill;
